import React from "react";

function Header() {
  return (
    <div>
      <h1>Hey! My name is Zachary Dagnall.</h1>
      <h4>
        Please visit my <a>LinkedIn</a> or my <a>GitHub</a> to get in touch with
        me or see what I've been working on
      </h4>
    </div>
  );
}

export default Header;
